import React, { useState } from 'react';
import { 
  Container, 
  Box, 
  TextField, 
  Button, 
  Paper, 
  Typography,
  List,
  ListItem,
  ListItemText,
  Divider,
  ThemeProvider,
  createTheme
} from '@mui/material';
import SendIcon from '@mui/icons-material/Send';
import PetsIcon from '@mui/icons-material/Pets';

// 커스텀 테마 생성
const theme = createTheme({
  palette: {
    primary: {
      main: '#FFB6C1', // 연한 분홍색
    },
    background: {
      default: '#FFF8E1', // 연한 노란색 배경
      paper: '#FFFFFF',
    },
  },
  typography: {
    fontFamily: '"Comic Sans MS", "Comic Sans", cursive',
  },
  components: {
    MuiButton: {
      styleOverrides: {
        root: {
          borderRadius: 20,
        },
      },
    },
    MuiTextField: {
      styleOverrides: {
        root: {
          '& .MuiOutlinedInput-root': {
            borderRadius: 20,
          },
        },
      },
    },
  },
});

function App() {
  const [messages, setMessages] = useState([]);
  const [input, setInput] = useState('');

  const handleSend = async () => {
    if (input.trim() === '') return;
    
    // 사용자 메시지 추가
    const newMessage = {
      text: input,
      sender: 'user',
      timestamp: new Date().toLocaleTimeString()
    };
    
    setMessages([...messages, newMessage]);
    setInput('');

    // TODO: 여기에 백엔드 API 호출 로직 추가
    // 백엔드 API 호출 예시
    const response = await fetch('YOUR_BACKEND_API_URL', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({ message: input }),
    });
    const data = await response.json();

    // 임시 응답 메시지
    setTimeout(() => {
      const botResponse = {
        text: "죄송합니다. 아직 백엔드가 연결되지 않았습니다.",
        sender: 'bot',
        timestamp: new Date().toLocaleTimeString()
      };
      setMessages(prev => [...prev, botResponse]);
    }, 1000);
  };

  return (
    <ThemeProvider theme={theme}>
      <Box sx={{ 
        minHeight: '100vh', 
        backgroundColor: 'background.default',
        py: 2
      }}>
        <Container maxWidth="sm">
          <Box sx={{ 
            height: '100vh', 
            display: 'flex', 
            flexDirection: 'column',
            position: 'relative'
          }}>
            <Box sx={{ 
              display: 'flex', 
              alignItems: 'center', 
              justifyContent: 'center',
              mb: 2,
              gap: 1
            }}>
              <PetsIcon sx={{ fontSize: 40, color: 'primary.main' }} />
              <Typography 
                variant="h4" 
                component="h1" 
                sx={{ 
                  color: 'primary.main',
                  fontWeight: 'bold'
                }}
              >
                강아지 정보 챗봇
              </Typography>
              <PetsIcon sx={{ fontSize: 40, color: 'primary.main' }} />
            </Box>
            
            <Paper 
              elevation={3} 
              sx={{ 
                flex: 1, 
                mb: 2, 
                p: 2, 
                overflow: 'auto',
                backgroundColor: 'rgba(255, 255, 255, 0.9)',
                borderRadius: 4,
                border: '2px solid',
                borderColor: 'primary.main'
              }}
            >
              <List>
                {messages.map((message, index) => (
                  <React.Fragment key={index}>
                    <ListItem 
                      sx={{ 
                        justifyContent: message.sender === 'user' ? 'flex-end' : 'flex-start'
                      }}
                    >
                      <Paper
                        sx={{
                          p: 2,
                          backgroundColor: message.sender === 'user' ? 'primary.main' : '#fff',
                          maxWidth: '70%',
                          borderRadius: 4,
                          boxShadow: 2
                        }}
                      >
                        <ListItemText 
                          primary={message.text}
                          secondary={message.timestamp}
                          sx={{
                            '& .MuiListItemText-primary': {
                              color: message.sender === 'user' ? '#fff' : 'inherit'
                            }
                          }}
                        />
                      </Paper>
                    </ListItem>
                    <Divider sx={{ my: 1 }} />
                  </React.Fragment>
                ))}
              </List>
            </Paper>

            <Box sx={{ 
              display: 'flex', 
              gap: 1,
              backgroundColor: 'rgba(255, 255, 255, 0.9)',
              p: 2,
              borderRadius: 4,
              border: '2px solid',
              borderColor: 'primary.main'
            }}>
              <TextField
                fullWidth
                variant="outlined"
                placeholder="메시지를 입력하세요..."
                value={input}
                onChange={(e) => setInput(e.target.value)}
                onKeyPress={(e) => {
                  if (e.key === 'Enter') {
                    handleSend();
                  }
                }}
                sx={{
                  '& .MuiOutlinedInput-root': {
                    backgroundColor: '#fff'
                  }
                }}
              />
              <Button 
                variant="contained" 
                endIcon={<SendIcon />}
                onClick={handleSend}
                sx={{
                  px: 3,
                  backgroundColor: 'primary.main',
                  '&:hover': {
                    backgroundColor: 'primary.dark'
                  }
                }}
              >
                전송
              </Button>
            </Box>
          </Box>
        </Container>
      </Box>
    </ThemeProvider>
  );
}

export default App;
